import React, { useEffect, useState } from 'react'

function App() {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data);
      }
    )
  }, [])

  return (
    <div>
      {(typeof backendData.products === 'undefined') ? (
        <p>...Loading</p>
      ) : (
        backendData.products.map((product, i) => (
          <p key={i}>{product}</p>
        ))
      )}
    </div>
  )
}

export default App
